import React from 'react';
import { StyleSheet, Text, View } from 'react-native';
import styles from "./styles";

export default () => (
    <View style={styles.container}>
      <View style={styles.box}>
        <Text style={styles.boxText}>I'm in a box.</Text>
      </View>
    </View>
);
